webpackJsonp([0xf7d885077c9],{737:function(t,e){t.exports={data:{wordpressPost:{title:"Alcohol vs semen quality, Tamiflu trials and mindfulness: The Most Read Articles in October",content:'<p>October&#8217;s most read articles include a cross-sectional study by Jensen <em>et al.</em> on the association of habitual alcohol consumption and reduced semen quality in young men. We also have a report on the risk of bias in industry-funded oseltamivir (Tamiflu) trials by Jefferson <em>et al., </em>and<em> </em>the<em> </em>ever popular paper on a web-based mindfulness course for the relief of anxiety and depression by Krusche<em> et al</em>. has re-entered our top 10.</p>\n<p>&nbsp;</p>\n<table border="1" width="483" cellspacing="0" cellpadding="0">\n<tbody>\n<tr>\n<td valign="top" width="50">Rank</td>\n<td valign="top" width="132">Author(s)</td>\n<td valign="top" width="301">Title</td>\n</tr>\n<tr>\n<td width="50">1</td>\n<td width="132">Abu Dabrh <em>et al.</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/4/3/e003434.full">Health assessment of commercial drivers: a meta-narrative systematic review</a></td>\n</tr>\n<tr>\n<td width="50">2</td>\n<td width="132">Jensen <em>et al.</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/4/9/e005462.full">Habitual alcohol consumption associated with reduced semen quality and changes in reproductive hormones; a cross-sectional study among 1221 young Danish men</a></td>\n</tr>\n<tr>\n<td width="50">3</td>\n<td width="132">Marston <em>et al.</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/4/8/e004996.full">Anal heterosex among young people and implications for health promotion: a qualitative study in the UK</a></td>\n</tr>\n<tr>\n<td width="50">4</td>\n<td width="132">Rao <em>et al</em>.</td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/3/12/e004277.full">Do healthier foods and diet patterns cost more than less healthy options? A systematic review and meta-analysis</a></td>\n</tr>\n<tr>\n<td width="50">5</td>\n<td width="132">Jefferson<em> et al.</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/4/9/e005253.full?"> Risk of bias in industry-funded oseltamivir trials: comparison of core reports versus full clinical study reports</a></td>\n</tr>\n<tr>\n<td width="50">6</td>\n<td width="132">Cobb <em>et al.</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/4/1/e004089.full">Diffusion of an evidence-based smoking cessation intervention through Facebook: a randomised controlled trial study protocol</a></td>\n</tr>\n<tr>\n<td width="50">7</td>\n<td width="132">Kalesan <em>et al</em>.</td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/4/9/e005628.full">State-specific, racial and ethnic heterogeneity in trends of firearm-related fatality rates in the USA from 2000 to 2010</a></td>\n</tr>\n<tr>\n<td width="50">8</td>\n<td width="132">Stranges <em>et al.</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/4/9/e005878.full">Major health-related behaviours and mental well-being in the general population: the Health Survey for England</a></td>\n</tr>\n<tr>\n<td width="50">9</td>\n<td width="132">Krusche <em>et al.</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/3/11/e003498.full">Mindfulness online: an evaluation of the feasibility of a web-based mindfulness course for stress, anxiety and depression</a></td>\n</tr>\n<tr>\n<td width="50">10</td>\n<td width="132">Fourkala<em> et al.</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/4/9/e005400.full">Association of skirt size and postmenopausal breast cancer risk in older women: a cohort study within the UK Collaborative Trial of Ovarian Cancer Screening (UKCTOCS)</a></td>\n</tr>\n</tbody>\n</table>\n<p>&nbsp;</p>\n<p>Most read figures are based on pdf downloads and full text views. Abstract views are excluded.<!--TrendMD v2.4.3--></p>\n'},site:{siteMetadata:{title:"Gatsby for BMJ blog sites"}}},pathContext:{id:"1beb5a6b-3175-53e8-9c1b-9a6a567c734d"}}}});
